import{_ as t,c as e,o as l,N as i}from"./chunks/framework.6510d215.js";const y=JSON.parse('{"title":"「offer来了」浅谈前端面试中开发环境常考知识点","description":"","frontmatter":{"title":"「offer来了」浅谈前端面试中开发环境常考知识点","author":"周一","date":"2021-11-17","categories":["前端开发"],"tags":["offer来了"],"sidebar":"auto"},"headers":[{"level":1,"title":"🌱 序言","slug":"🌱-序言","link":"#🌱-序言","children":[]},{"level":1,"title":"🌲 一、git","slug":"🌲-一、git","link":"#🌲-一、git","children":[{"level":2,"title":"1、为什么要使用 git?","slug":"_1、为什么要使用-git","link":"#_1、为什么要使用-git","children":[]},{"level":2,"title":"2、常用的 git 命令","slug":"_2、常用的-git-命令","link":"#_2、常用的-git-命令","children":[]},{"level":2,"title":"3、git 提交规范","slug":"_3、git-提交规范","link":"#_3、git-提交规范","children":[]}]},{"level":1,"title":"🌳 二、Chrome 调试工具","slug":"🌳-二、chrome-调试工具","link":"#🌳-二、chrome-调试工具","children":[]},{"level":1,"title":"🌴 三、抓包","slug":"🌴-三、抓包","link":"#🌴-三、抓包","children":[{"level":2,"title":"1、抓包工具","slug":"_1、抓包工具","link":"#_1、抓包工具","children":[]},{"level":2,"title":"2、抓包过程","slug":"_2、抓包过程","link":"#_2、抓包过程","children":[]}]},{"level":1,"title":"🌾 四、linux 常用命令","slug":"🌾-四、linux-常用命令","link":"#🌾-四、linux-常用命令","children":[{"level":2,"title":"1、为什么要用 linux？","slug":"_1、为什么要用-linux","link":"#_1、为什么要用-linux","children":[]},{"level":2,"title":"2、linux 常用命令","slug":"_2、linux-常用命令","link":"#_2、linux-常用命令","children":[]}]},{"level":1,"title":"🌿 五、结束语","slug":"🌿-五、结束语","link":"#🌿-五、结束语","children":[]},{"level":1,"title":"🐣 彩蛋 One More Thing","slug":"🐣-彩蛋-one-more-thing","link":"#🐣-彩蛋-one-more-thing","children":[{"level":2,"title":"🏷️pdf 内容获取","slug":"🏷️pdf-内容获取","link":"#🏷️pdf-内容获取","children":[]},{"level":2,"title":"🏷️ 更新地址","slug":"🏷️-更新地址","link":"#🏷️-更新地址","children":[]}]}],"relativePath":"column/Interview/Development.md","lastUpdated":1685151998000}'),r={name:"column/Interview/Development.md"},n=i('<h1 id="🌱-序言" tabindex="-1">🌱 序言 <a class="header-anchor" href="#🌱-序言" aria-label="Permalink to &quot;🌱 序言&quot;">​</a></h1><p>在实际的开发中，开发环境的工具使用，能直观的体现出某个人的工作产出效率。因此，在面试中，面试官也会经常问到关于 <code>git</code> 、 <code>linux</code> 等常见的一些面试题。所以，了解相关方面的知识点也是很有必要滴~</p><p>那么在下面的这篇文章中，将讲解一些比较常见的开发环境下的知识点，以供大家备试使用。</p><p>一起来学习吧~🌱</p><h1 id="🌲-一、git" tabindex="-1">🌲 一、git <a class="header-anchor" href="#🌲-一、git" aria-label="Permalink to &quot;🌲 一、git&quot;">​</a></h1><h2 id="_1、为什么要使用-git" tabindex="-1">1、为什么要使用 git? <a class="header-anchor" href="#_1、为什么要使用-git" aria-label="Permalink to &quot;1、为什么要使用 git?&quot;">​</a></h2><ul><li>最常用的代码版本管理工具；</li><li>大型项目需要多人协作开发，必须熟用 <code>git</code> ；</li><li>如果你知道 <code>git</code> 或者之前不用 <code>git</code> ，很难通过面试；</li><li><code>Mac OS</code> 自带 <code>git</code> 命令， <code>windows</code> 可去官网下载；</li><li><code>git</code> 服务端常见的有 <code>github</code> 、 <code>coding.net</code> 等；</li><li>大公司会搭建自己的内网 <code>git</code> 服务。</li></ul><h2 id="_2、常用的-git-命令" tabindex="-1">2、常用的 git 命令 <a class="header-anchor" href="#_2、常用的-git-命令" aria-label="Permalink to &quot;2、常用的 git 命令&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">命令</th><th style="text-align:center;">用途</th></tr></thead><tbody><tr><td style="text-align:center;">git init</td><td style="text-align:center;">初始化一个仓库</td></tr><tr><td style="text-align:center;">git clone</td><td style="text-align:center;">克隆项目</td></tr><tr><td style="text-align:center;">git add .</td><td style="text-align:center;">把所有文件添加上。如果后面有文件名，则只把该文件参加上</td></tr><tr><td style="text-align:center;">git status</td><td style="text-align:center;">随时掌握工作区的状态</td></tr><tr><td style="text-align:center;">git diff</td><td style="text-align:center;">如果 Git status 告诉你有文件被修改过，用 git diff 可以查看修改内容</td></tr><tr><td style="text-align:center;">git commit -m &quot;xxx&quot;</td><td style="text-align:center;">提交一行记录</td></tr><tr><td style="text-align:center;">git push origin master</td><td style="text-align:center;">提交到服务端</td></tr><tr><td style="text-align:center;">git pull origin master</td><td style="text-align:center;">从服务端拉代码下来</td></tr><tr><td style="text-align:center;">git branch xxx</td><td style="text-align:center;">创建新分支，每个人都需要有自己的分支，互不干扰</td></tr><tr><td style="text-align:center;">git checkout -b xxx / git checkout xxx</td><td style="text-align:center;">切换分支</td></tr><tr><td style="text-align:center;">git merge xxx</td><td style="text-align:center;">做完之后要把主分支合并</td></tr><tr><td style="text-align:center;">git stash</td><td style="text-align:center;">把写错的代码先放一边，之后切换分支再放上去</td></tr><tr><td style="text-align:center;">git log</td><td style="text-align:center;">穿梭前，用 git log 可以查看提交历史，以便确定要回退到哪个版本</td></tr><tr><td style="text-align:center;">git reflog</td><td style="text-align:center;">要重返未来，用 git reflog 查看命令历史，以便确定要回到未来的哪个版本。</td></tr><tr><td style="text-align:center;">git log --graph</td><td style="text-align:center;">可以看到分支合并图</td></tr></tbody></table><h2 id="_3、git-提交规范" tabindex="-1">3、git 提交规范 <a class="header-anchor" href="#_3、git-提交规范" aria-label="Permalink to &quot;3、git 提交规范&quot;">​</a></h2><p>下面用一张图来了解下平常我们在提交代码时， <code>git</code> 的一些规范。<strong>具体如下图：</strong></p><p><img src="https://mondaylab-1309616765.cos.ap-shanghai.myqcloud.com/images/202305270824291.png" alt="git提交规范"></p><h1 id="🌳-二、chrome-调试工具" tabindex="-1">🌳 二、Chrome 调试工具 <a class="header-anchor" href="#🌳-二、chrome-调试工具" aria-label="Permalink to &quot;🌳 二、Chrome 调试工具&quot;">​</a></h1><ul><li>Elements</li><li>Network</li><li>Console</li><li>Application</li><li>debugger</li><li>查看内存泄漏等等</li></ul><h1 id="🌴-三、抓包" tabindex="-1">🌴 三、抓包 <a class="header-anchor" href="#🌴-三、抓包" aria-label="Permalink to &quot;🌴 三、抓包&quot;">​</a></h1><h2 id="_1、抓包工具" tabindex="-1">1、抓包工具 <a class="header-anchor" href="#_1、抓包工具" aria-label="Permalink to &quot;1、抓包工具&quot;">​</a></h2><ul><li>移动端 <code>h5</code> 页，<strong>查看网络请求</strong>，需要用工具抓包；</li><li><code>windows</code> 一般用 <code>fiddler</code> 抓包；</li><li><code>Mac OS</code> 一般用 <code>charles</code> 来进行抓包。</li></ul><h2 id="_2、抓包过程" tabindex="-1">2、抓包过程 <a class="header-anchor" href="#_2、抓包过程" aria-label="Permalink to &quot;2、抓包过程&quot;">​</a></h2><ul><li>手机和电脑连接同一个局域网；</li><li>将手机代理到电脑上；</li><li>手机浏览网页，即可抓包；</li><li>查看网络请求；</li><li>网址代理；</li><li><code>https</code> 。</li></ul><h1 id="🌾-四、linux-常用命令" tabindex="-1">🌾 四、linux 常用命令 <a class="header-anchor" href="#🌾-四、linux-常用命令" aria-label="Permalink to &quot;🌾 四、linux 常用命令&quot;">​</a></h1><h2 id="_1、为什么要用-linux" tabindex="-1">1、为什么要用 linux？ <a class="header-anchor" href="#_1、为什么要用-linux" aria-label="Permalink to &quot;1、为什么要用 linux？&quot;">​</a></h2><ul><li>公司的线上机器一般都是 <code>linux</code> （比如阿里云）；</li><li>测试机也需要保持使用一致的 <code>linux</code> ；</li><li>测试机或者线上机出了问题，本地又不能复现，需要去排查（比如，别人的手机没有问题，另外一个人的手机出现问题，本地环境又不能看是什么错误，这个时候就一定一定要去排查）。</li></ul><h2 id="_2、linux-常用命令" tabindex="-1">2、linux 常用命令 <a class="header-anchor" href="#_2、linux-常用命令" aria-label="Permalink to &quot;2、linux 常用命令&quot;">​</a></h2><p><strong>如下表格：</strong></p><table><thead><tr><th style="text-align:center;">命令</th><th style="text-align:center;">含义</th></tr></thead><tbody><tr><td style="text-align:center;">ssh 用户名@ip 地址，如 ssh <a href="mailto:root@192.168.10.21" target="_blank" rel="noreferrer">root@192.168.10.21</a></td><td style="text-align:center;">登录 linux 的线上机或者测试机</td></tr><tr><td style="text-align:center;">ls</td><td style="text-align:center;">查看当前文件目录下的所有文件夹</td></tr><tr><td style="text-align:center;">ls -a</td><td style="text-align:center;">把隐藏文件夹也一并显示出来</td></tr><tr><td style="text-align:center;">ll</td><td style="text-align:center;">ls 是平铺看文件，ll 是以列表的形式查看所有文件（包括隐藏文件）</td></tr><tr><td style="text-align:center;">clear</td><td style="text-align:center;">清空屏幕</td></tr><tr><td style="text-align:center;">mkdir 文件名，如 mkdir abc</td><td style="text-align:center;">创建文件夹</td></tr><tr><td style="text-align:center;">rm 文件名</td><td style="text-align:center;">删除文件</td></tr><tr><td style="text-align:center;">rm -rf 文件名，如 rm -rf abc</td><td style="text-align:center;">删除文件夹</td></tr><tr><td style="text-align:center;">mv 旧文件名 新文件名，如 mv index.html index1.html</td><td style="text-align:center;">修改文件 index.html 的名字为 index1.html</td></tr><tr><td style="text-align:center;">tab 键</td><td style="text-align:center;">对单词进行填满</td></tr><tr><td style="text-align:center;">cd ../</td><td style="text-align:center;">回到上级目录</td></tr><tr><td style="text-align:center;">cp 文件名 1 文件名 2，如 cp a.js b.js</td><td style="text-align:center;">拷贝一份 a.js，新拷贝的文件命名为 b.js</td></tr><tr><td style="text-align:center;">touch 文件名，如 touch b.js</td><td style="text-align:center;">建立一个空文件</td></tr><tr><td style="text-align:center;">vi 文件名</td><td style="text-align:center;">往文件里面添加内容，</td></tr><tr><td style="text-align:center;">vim 文件名</td><td style="text-align:center;">往文件里面添加内容，通过 i 键进入编写，es 键退出编写，:w 进行保存，:q!强制退出</td></tr><tr><td style="text-align:center;">vimtutor</td><td style="text-align:center;">查看 vim 的教程</td></tr><tr><td style="text-align:center;">cat 文件名</td><td style="text-align:center;">打印出该文件的所有内容</td></tr><tr><td style="text-align:center;">head 文件名</td><td style="text-align:center;">打印出前面几行</td></tr><tr><td style="text-align:center;">tail 文件名</td><td style="text-align:center;">打印出最后几行</td></tr><tr><td style="text-align:center;">grep “关键字” 文件名，如 grep “babel” package.json</td><td style="text-align:center;">查询某个文件里面包含关键字的内容</td></tr></tbody></table><h1 id="🌿-五、结束语" tabindex="-1">🌿 五、结束语 <a class="header-anchor" href="#🌿-五、结束语" aria-label="Permalink to &quot;🌿 五、结束语&quot;">​</a></h1><p>以上文章讲解了在面试中一些常考的开发环境知识，对于前端的面试来说，开发环境相关的内容考察的相对比较少，所以大家可以通过本文做一个简单的了解。</p><p>到这里，关于开发环境的一些常见知识讲到这里就结束啦！希望对大家有帮助~</p><h1 id="🐣-彩蛋-one-more-thing" tabindex="-1">🐣 彩蛋 One More Thing <a class="header-anchor" href="#🐣-彩蛋-one-more-thing" aria-label="Permalink to &quot;🐣 彩蛋 One More Thing&quot;">​</a></h1><h2 id="🏷️pdf-内容获取" tabindex="-1">🏷️pdf 内容获取 <a class="header-anchor" href="#🏷️pdf-内容获取" aria-label="Permalink to &quot;🏷️pdf 内容获取&quot;">​</a></h2><p>👉 微信搜索 <code>星期一研究室</code> 并关注，回复关键词 <code>开发环境面试pdf</code> 获取相关 <code>pdf</code> 内容~</p><p>👉 回复 <code>面试大全pdf</code> 可获取全专栏内容！</p><h2 id="🏷️-更新地址" tabindex="-1">🏷️ 更新地址 <a class="header-anchor" href="#🏷️-更新地址" aria-label="Permalink to &quot;🏷️ 更新地址&quot;">​</a></h2><p>👉 <a href="https://juejin.cn/column/7007991853089849351" target="_blank" rel="noreferrer">offer 来了面试专栏</a></p>',34),a=[n];function d(c,o,s,g,h,x){return l(),e("div",null,a)}const m=t(r,[["render",d]]);export{y as __pageData,m as default};
